using System.Linq;
using Microsoft.VisualStudio.TestTools.UnitTesting;
using TensorShader;
using static TensorShader.Field;

namespace TensorShaderTest.Links.ComplexConvolution {
    [TestClass]
    public class ComplexConvolution2DTest {
        [TestMethod]
        public void ReferenceTest() {
            int inchannels = 6, outchannels = 8, kwidth = 3, kheight = 5, inwidth = 13, inheight = 17;
            int outwidth = inwidth - kwidth + 1, outheight = inheight - kheight + 1, batch = 3;

            float[] xval = (new float[inwidth * inheight * inchannels * batch]).Select((_, idx) => idx * 1e-3f).ToArray();
            float[] yval = (new float[outwidth * outheight * outchannels * batch]).Select((_, idx) => idx * 1e-3f).ToArray();
            float[] wval = (new float[kwidth * kheight * outchannels * inchannels / 2]).Select((_, idx) => idx * 1e-3f).Reverse().ToArray();

            ParameterField x = new Tensor(Shape.Map2D(inchannels, inwidth, inheight, batch), xval);
            ParameterField w = new Tensor(Shape.Kernel2D(inchannels, outchannels / 2, kwidth, kheight), wval);
            VariableField y_actual = new Tensor(Shape.Map2D(outchannels, outwidth, outheight, batch), yval);

            Field y_expect = ComplexConvolution2D(x, w);
            Field err = y_expect - y_actual;

            (Flow flow, Parameters parameters) = Flow.Optimize(err);

            flow.Execute();

            float[] gx_actual = x.GradState;
            float[] gw_actual = w.GradState;

            AssertError.Tolerance(gw_expect, gw_actual, 1e-7f, 1e-5f, $"not equal gw");

            AssertError.Tolerance(gx_expect, gx_actual, 1e-7f, 1e-5f, $"not equal gx");
        }

        [TestMethod]
        public void TheoreticalTest() {
            int inchannels = 6, outchannels = 8, kwidth = 3, kheight = 5, inwidth = 13, inheight = 17;
            int outwidth = inwidth - kwidth + 1, outheight = inheight - kheight + 1, batch = 3;

            float[] xval = (new float[inwidth * inheight * inchannels * batch]).Select((_, idx) => idx * 1e-3f).ToArray();
            float[] yval = (new float[outwidth * outheight * outchannels * batch]).Select((_, idx) => idx * 1e-3f).ToArray();
            float[] wval = (new float[kwidth * kheight * outchannels * inchannels / 2]).Select((_, idx) => idx * 1e-3f).Reverse().ToArray();

            ParameterField x = new Tensor(Shape.Map2D(inchannels, inwidth, inheight, batch), xval);
            ParameterField w = new Tensor(Shape.Kernel2D(inchannels, outchannels / 2, kwidth, kheight), wval);
            VariableField y_actual = new Tensor(Shape.Map2D(outchannels, outwidth, outheight, batch), yval);

            Field x_real = ComplexReal(x), x_imag = ComplexImag(x);
            Field w_real = ComplexReal(w), w_imag = ComplexImag(w);

            Field y_real = Convolution2D(x_real, w_real) - Convolution2D(x_imag, w_imag);
            Field y_imag = Convolution2D(x_imag, w_real) + Convolution2D(x_real, w_imag);

            Field y_expect = ComplexCast(y_real, y_imag);

            Field err = y_expect - y_actual;

            (Flow flow, Parameters parameters) = Flow.Optimize(err);

            flow.Execute();

            float[] gx_actual = x.GradState;
            float[] gw_actual = w.GradState;

            AssertError.Tolerance(gw_expect, gw_actual, 1e-7f, 1e-5f, $"not equal gw");

            AssertError.Tolerance(gx_expect, gx_actual, 1e-7f, 1e-5f, $"not equal gx");
        }

